import { useEffect, useRef } from 'react';

const AsciiArtAnimation = () => {
  const canvasRef = useRef(null);
  const imgData = {
    data: [],
  };

  const state = {
    showImage: false,
    particles: [],
    particleCount: 5000,
    targetPositions: [],
    falling: true,
    animationFrameId: null,
  };

  useEffect(() => {
    const canvas = canvasRef.current;
    const context = canvas.getContext('2d');

    const img = new Image();
    img.src = 'data:image/png;base64,';

    function initializeAnimation() {
      canvas.width = img.width;
      canvas.height = img.height;
      context.drawImage(img, 0, 0, img.width, img.height);

      imgData.data = context.getImageData(0, 0, img.width, img.height).data;

      for (let i = 0; i < state.particleCount; i++) {
        const particle = {
          x: Math.random() * canvas.width,
          y: Math.random() * -50,
          character: '',
          color: '',
          targetX: i % (canvas.width / 10) * 10,
          targetY: Math.floor(i / (canvas.width / 10)) * 10,
        };
        state.particles.push(particle);
      }

      function getColorAt(x, y) {
        const pixelIndex = (x + y * img.width) * 4;
        const r = imgData.data[pixelIndex];
        const g = imgData.data[pixelIndex + 1];
        const b = imgData.data[pixelIndex + 2];
        return `rgba(${r}, ${g}, ${b}, 1)`;
      }

      function drawAscii() {
        context.clearRect(0, 0, canvas.width, canvas.height);

        if (state.falling) {
          for (let i = 0; i < state.particleCount; i++) {
            const particle = state.particles[i];
            if (particle.y < particle.targetY) {
              particle.y += 2;
            } else {
              state.falling = false;
            }
            context.fillStyle = 'white';
            context.fillRect(particle.x, particle.y, 10, 10);
          }
        } else {
          if (state.showImage) {
            context.drawImage(img, 0, 0, img.width, img.height);
          } else {
            for (let i = 0; i < state.particleCount; i++) {
              const particle = state.particles[i];
              const dx = particle.targetX - particle.x;
              const dy = particle.targetY - particle.y;
              const distance = Math.sqrt(dx * dx + dy * dy);
              if (distance > 1) {
                particle.x += dx * 0.05;
                particle.y += dy * 0.05;
              } else {
                particle.x = particle.targetX;
                particle.y = particle.targetY;
              }
              context.fillStyle = getColorAt(particle.x, particle.y);
              context.fillRect(particle.x, particle.y, 10, 10);
            }
          }
        }

        state.animationFrameId = requestAnimationFrame(drawAscii);

        if (state.showImage) {
          // Reiniciar la animacin despus de un tiempo
          setTimeout(() => {
            state.showImage = false;
            state.falling = true;
            requestAnimationFrame(drawAscii);
          }, 6000);
        }
      }

      // Iniciar la animacin
      drawAscii();
    }

    img.onload = initializeAnimation;

    return () => {
      // Limpiar el bucle de animacin cuando el componente se desmonte
      if (state.animationFrameId) {
        cancelAnimationFrame(state.animationFrameId);
      }
    };
  }, []);

  return <canvas ref={canvasRef} className='block mx-auto transition-all' />;
};

export default AsciiArtAnimation;
